// sort into ascending value  
// using the insertion sort algorithm 

public static int sort(String[] vals){ 
  int count = 0;    

  for(int i = 1; i < vals.length; i++){ 
    int j = i - 1; 
    String cur = vals[i]; 

    while( j >= 0 && cur < vals[j] ){ 
      vals[j + 1] = vals[j--]; 
      count++; 
    } 

    vals[j + 1] = cur; 
  } 
  return count; 
}

