public static int find(int[][] mat, int t){ 
  final int L = mat.length - 1; 
  int res = 0; 
  boolean ok = true; 
  int c = 0; 
  int i; 

  while( c < mat.length ){ 
    ok = mat[c][L] >= t && mat[L][c] >= t; 
    if( ok ){ 
      i = 1; 
      while( ok && i <= L ){ 
        ok = mat[c][i] <= mat[c][i-1]; 
        ok =ok && mat[i][c] <= mat[i-1][c]; 
        i++; 
      } 
      res = ok ? res + 1 : res; 
    } 
    c++; 
  } 
  return res; 
}

